  KEY `fk_Shipment Fact_Time Dimension1_idx` (`Time_Departed`),
  KEY `fk_Shipment Fact_Timezone Dimension1_idx` (`Timezone_Departed`),
  KEY `fk_Shipment Fact_Date Dimension2_idx` (`Date_Arrived`),
  KEY `fk_Shipment Fact_Time Dimension2_idx` (`Time_Arrived`),
  KEY `fk_Shipment Fact_Timezone Dimension2_idx` (`Timezone_Arrived`),
  CONSTRAINT `fk_Shipment Fact_Date Dimension1` FOREIGN KEY (`Date_Departed`) REFERENCES `date_dimension` (`Date_Key`),
