  CONSTRAINT `fk_Shipment Fact_Port Dimension1` FOREIGN KEY (`Destination`) REFERENCES `port_dimension` (`Port_Key`),
  CONSTRAINT `fk_Shipment Fact_Port Dimension2` FOREIGN KEY (`Origin`) REFERENCES `port_dimension` (`Port_Key`),
  CONSTRAINT `fk_Shipment Fact_Product Dimension` FOREIGN KEY (`Product`) REFERENCES `product_dimension` (`Product_Key`),
  CONSTRAINT `fk_Shipment Fact_Time Dimension1` FOREIGN KEY (`Time_Departed`) REFERENCES `time_dimension` (`Time_Key`),
  CONSTRAINT `fk_Shipment Fact_Time Dimension2` FOREIGN KEY (`Time_Arrived`) REFERENCES `time_dimension` (`Time_Key`),
  CONSTRAINT `fk_Shipment Fact_Timezone Dimension1` FOREIGN KEY (`Timezone_Departed`) REFERENCES `timezone_dimension` (`Timezone_Key`),
